import pandas as pd


def add_id_column_to_csv(input_file, output_file, id_list):
    # Read the existing CSV file
    df = pd.read_csv(input_file)

    # Ensure the list length matches the DataFrame length
    if len(id_list) < len(df):
        id_list += [None] * (len(df) - len(id_list))  # Pad with None if list is too short
    elif len(id_list) > len(df):
        id_list = id_list[:len(df)]  # Trim the list if it's too long

    # Add the new 'ID' column
    df['ID'] = id_list

    # Save the modified DataFrame back to a new CSV file
    df.to_csv(output_file, index=False)


